Nail Stamping Plate Nail Stamper - Ejiubas Nail Stamping Kit Nail Art Stamp 3 Pcs Nail Stamper Plates 1 Clear Nail Art Stamper DIY Nail Stamp Kit EJB-01 06 08
Ejiubas
Stamping plate & Stamper set
Description: <b></br>Nail stamping plates：</b></br> -Suitable Design,easy to handle and carry, comfortable handling and a protective nylon screen;</br> -Easy to use for both beginners and experienced nail artists;</br> -Material: Stainless Steel;</br> </br> <b>Nail stamper :</b></br> -Sandy scraper, thin but firm and comfortable for holding, easy to scrape the exceed polish from plates</br> -Material: silicone stamper & plastic handle;</br> -Note: Don’t use 100% acetone and nail polish removers or shark tools to clean this stamper head. Just use a lint roller or tape to remove residual nail polish after each uses</br> </br> <b>Package Contents:</b></br> -3 Pcs Stamping Plates and 1 nail stamper and scraper (random color) </br> </br> <b>Instruction Of Nail Plates:</b> 1. Apply base coat or regular polish on the nail ;</br> 2. Apply the nail polish to desired image within a nail plate ;</br> 3. Make a scraper leaned over 45 degrees and scrape excessive polish off quickly and strongly from inside to outside ;</br> 4. Immediately press the stamper with a gentle rolling motion to pick up the design. The image is transferred on the nail stamp ;</br> 5. Stamp the image on your nail with a gentle rolling motion. The image is transferred on your nail ;</br> 6. Repeat the above steps for all of your nails ;</br> 7. After stamping nail art, apply top coat for lasting wear.</br> </br> <b>Instruction Of Nail Stamper:</b> 1. Apply base coat or regular polish on nail;</br> 2. Apply nail polish to desired image within a plate;</br> 3. Scrape across plate with the scraper to remove excessive polish;</br> 4. Quickly press the stamper onto the plate to pick up the design;</br> 5. Stamp the image onto your nail with a rolling motion or just press down
